const e="sv",t="Patric Keisala",a=" | Malmö | Webb/Spel Utvecklare",n=["Jag är en engagerad utvecklare med expertis inom både spel- och webbutveckling, och min resa började år 2015. Jag har en bred kunskap inom programmering och en genuin passion för att utveckla mina kunskaper. Min karriär började inom webbutveckling och senare utvidgade jag min kompetens till spelutveckling med fokus på Unity och C#.","Jag gillar att utveckla innovativa system och funktioner med inriktning på återanvändbarhet. Jag söker att växa inom olika områden, inklusive backend och frontend-utveckling, samt spelprogrammering."],i={title:"Specialisering",items:["Frontend Webbutveckling: Specialiserad på att utveckla responsiva användargränssnitt för webbapplikationer.","Backend-utveckling: Skicklig på att skapa serverlogik och databaser för att stödja webb-, spel- och mobila applikationer.","Spelutveckling: Skicklig på att utveckla interaktiva spel och assets med Unity och C#.","Databashantering: Erfaren inom hantering av både SQL- och NoSQL-databaser."]},r={title:"Prestationer",items:["Publicerat och stöttat Unity Assets på Unity Asset Store i över två år, vilket har stöttat en global användarbas.","Behållit en konsekvent hög användarrecension på 5 stjärnor."]},s={locale:e,title:t,sub:a,introduction:n,spec:i,achievements:r};export{r as achievements,s as default,n as introduction,e as locale,i as spec,a as sub,t as title};
